// pages/jobBoard.js

import React from "react";

const jobBoard = () => {
	return (
		<div>
        <div className='sample-css'>Job Postings</div>

        <div className='box'>
            <div className='bodystyle'>
Job Description            </div>
			<div className='bodystyle'>
User            </div>            
			<div className='bodystyle'>
                Our mission is to empower individuals who are new to the community or transitioning from challenging circumstances by connecting them with meaningful employment opportunities. We believe in the dignity of work and the value of every person's contribution to society. We strive to bridge the gap between skilled laborers and local businesses, fostering a network of support and collaboration that uplifts both workers and employers. By providing a platform for connection and growth, we aim to enhance the economic well-being and social integration of those who are often overlooked, ensuring that everyone has the chance to build a stable, prosperous future.We believe there are many people out there who are overlooked due to reasons such as past issues, etc. Whether you're a returning citizen, a refugee, or have faced other challenges in your past, Credibly is here to assist you in finding employment opportunities that match your skills and aspirations.
            </div>
        </div>
        </div>
	);
};

export default jobBoard;
